 Here is a simple function in JavaScript that sorts an array of strings in alphabetical order:

```javascript
function sortArrayOfStrings(arr) {
    return arr.sort();
}

// Example usage:
let words = ['cat', 'banana', 'apple', 'dog'];
console.log(sortArrayOfStrings(words));
// Output: [ 'apple', 'banana', 'cat', 'dog' ]
```

This function uses the `sort()` method provided by JavaScript's Array object to sort the array. By default, `sort()` converts each element into a string and compares their sequences of UTF-16 code unit values.

Please note that this will work correctly for most cases, but it may not always provide correct results when dealing with non-English characters or special symbols because those can have different byte values in UTF-16. If you need to sort specifically by English alphabetical order, you might want to consider adding a comparison function as follows:

```javascript
function sortArrayOfStrings(arr) {
    return arr.sort((a, b) => a.localeCompare(b));
}

// Example usage:
let words = ['cat', 'banana', 'apple', 'dog', 'äpple'];
console.log(sortArrayOfStrings(words));
// Output: [ 'apple', 'äpple', 'banana', 'cat', 'dog' ]
```
Here, we use `localeCompare()`, which compares two strings based on the current or specified locale. This ensures proper sorting even with non-English characters.

 Sure, here is a simple implementation of the bubble sort algorithm for sorting an array of strings in alphabetical order:
```
function bubbleSortStrings(arr) {
  let len = arr.length;
  for (let i = 0; i < len; i++) {
    for (let j = 0; j < len - 1 - i; j++) {
      if (arr[j] > arr[j+1]) {
        // swap arr[j] and arr[j+1]
        let temp = arr[j];
        arr[j] = arr[j+1];
        arr[j+1] = temp;
      }
    }
  }
  return arr;
}
```
You can call this function with an array of strings as an argument, like so:
```
let namesArray = ["John", "Alice", "Bob", "Emily"];
console.log(bubbleSortStrings(namesArray)); // Output: ["Alice", "Bob", "Emily", "John"]
``` 
This implementation sorts the array using bubble sort algorithm, which is a simple but not efficient sorting algorithm for small arrays.


