 Sure, here is an example implementation of a function that sorts an array of strings in alphabetical order using bubble sort algorithm:
```
function bubbleSortStrings(arr) {
  let swapped = true;
  do {
    swapped = false;
    for (let i=0; i < arr.length - 1; i++) {
      if (arr[i] > arr[i+1]) {
        let temp = arr[i];
        arr[i] = arr[i+1];
        arr[i+1] = temp;
        swapped = true;
      }
    }
  } while (swapped);

  return arr;
}
```
You can call this function by passing an array of strings to it, like so: `bubbleSortStrings(["apple", "banana", "cherry"])`. This will return the sorted array in alphabetical order.
